import React from "react";

const ResetButton = ({ restart }) => {
  return (
    <button className="relative inline-block px-8 py-3 my-10 overflow-hidden border border-blue-600 group focus:outline-none focus:ring">
      <span className="absolute inset-y-0 left-0 w-[2px] bg-blue-600 transition-all group-hover:w-full group-active:bg-blue-500"></span>
      <button
        className="relative text-sm font-medium text-blue-600 transition-colors group-hover:text-white"
        onClick={restart}>
        ResetButton
      </button>
    </button>
  );
};

export default ResetButton;
